package com.everlive.user.action;import com.everlive.user.bo.UserForm;import com.everlive.user.service.UserManagerService;import com.opensymphony.xwork2.ActionSupport;public class RegisterAction extends ActionSupport {	/**	 * 	 */	private static final long serialVersionUID = 8855477710710420814L;	private UserForm user;  		private UserManagerService userManagerService;  			public void setUser(UserForm user) {  	    this.user = user;  	}  		public String execute() {  	    try {  	    	userManagerService.regUser(user);  	        return SUCCESS;  		    } catch (Exception e) {  	        e.printStackTrace();  	        return ERROR;  	    }  	}	public UserManagerService getUserManagerService() {		return userManagerService;	}	public void setUserManagerService(UserManagerService userManagerService) {		this.userManagerService = userManagerService;	}	public UserForm getUser() {		return user;	}	}